    setSelectedDate(date);
  };
  return (
    <div>
      <Navbar />
      <img src={exampleImage} alt="The Aerospace Corporation" class="img" />
      <Button />
      <Timer />
      <ColorScaleComponent />
      <DateSelector onDateSelect={handleDateSelect} />
